import React from 'react';

const IdeaCard = ({ title, body, id }) => {
  console.log(title, body, id)
  return (
    <div key={id} className="ideaCard">
      <h1>{title}</h1>
      <p>{body}</p>
    </div>
  )
}

export default IdeaCard;
